import React from 'react';
import {backgroundParticlesConfig} from './configs/particlesConfig';
import {Container} from 'tsparticles/dist/Core/Container';


import Particles from 'react-tsparticles';
import {modalStateInterface} from '../interfaces/stateInterfaces';

interface properties {
	properties: modalStateInterface;
}

class BackGroundParticles extends React.Component<properties>{

	public particlesContainer: Container | undefined;

	constructor(properties:properties) {
		super(properties);
		this.particlesInit = this.particlesInit.bind(this);
		this.particlesLoaded = this.particlesLoaded.bind(this);
	}

	componentDidMount() {
		// this.particlesContainer = new Container('background');
	}

	particlesInit(main) {
		console.log(main);

		// you can initialize the tsParticles instance (main) here, adding custom shapes or presets
	}

	particlesLoaded(container) {
		console.log(container);
	}

	render(){
		return(
			<Particles loaded={this.particlesLoaded} params={JSON.parse(JSON.stringify(backgroundParticlesConfig )) }/>
		);
	}
}

export const MemorizedBackgroundParticles = React.memo(BackGroundParticles);
